/**
 * @author Dzmitry Rusak
 */
public class FieldEditorPanel extends FlexTable {
    private FieldsPanel fieldsPanel;

    public FieldEditorPanel(FieldsPanel fieldsPanel) {
        this.fieldsPanel = fieldsPanel;
    }

    public void init() {
        FlexTable.FlexCellFormatter cellFormatter = getFlexCellFormatter();
        setCellSpacing(5);
        setHTML(0, 0, "<h2>Field property</h2>");
        cellFormatter.setColSpan(0, 0, 2);

        setHTML(1, 0, "<b>Name</b><span style='color:red'>*</span>");
        setWidget(1, 1, new TextBox());

        setHTML(2, 0, "<b>Label</b><span style='color:red'>*</span>");
        setWidget(2, 1, new TextBox());

        setHTML(2, 0, "<b>Description</b><span style='color:red'>*</span>");
        setWidget(2, 1, new TextBox());

        setHTML(3, 0, "<b>Type</b><span style='color:red'>*</span>");
        ListBox types = new ListBox();
        types.addItem("Input");
        types.addItem("Listbox");
        types.addItem("Radio");
        setWidget(3, 1, types);

        setHTML(4, 0, "<b>Data type</b><span style='color:red'>*</span>");
        ListBox dataTypes = new ListBox();
        dataTypes.addItem("String");
        dataTypes.addItem("Integer");
        dataTypes.addItem("Date");
        setWidget(4, 1, dataTypes);

        Button cancelButton = new Button("Cancel");
        cancelButton.addClickHandler(new ClickHandler() {
            @Override
            public void onClick(ClickEvent event) {
                fieldsPanel.changeViewStandard();
            }
        });
        Button saveButton = new Button("Save");
        saveButton.addClickHandler(new ClickHandler() {
            @Override
            public void onClick(ClickEvent event) {
                fieldsPanel.changeViewStandard();
            }
        });
        HorizontalPanel buttonsPanel = new HorizontalPanel();
        buttonsPanel.setSpacing(10);
        buttonsPanel.add(cancelButton);
        buttonsPanel.add(saveButton);
        setWidget(5, 0, buttonsPanel);
        cellFormatter.setColSpan(5, 0, 2);
        cellFormatter.setAlignment(5, 0, HorizontalPanel.ALIGN_CENTER, VerticalPanel.ALIGN_MIDDLE);
    }
}
